import React from 'react';
import {Link} from 'react-router-dom';

function Header() {
  return (
    <nav>
    <div>
     <Link to="/">Home</Link> | <Link to="/Products">Products</Link>
     </div>
     <div>
       <Link to="/Cart">Cart</Link> | <Link to="/Checkout">Checkout</Link>
     </div>
     </nav>
  )
}

export default Header;
